ntInSubtitleLocaleCode"":null,""OverlayFiles"":null,""AudioTracks"":[{""LocaleCode"":""en-US"",""AudioEncoding"":""DolbyDigitalPlus"",""Channel"":null}]}],""Awards"":null,""ReviewSets"":[{""ReviewerMediaId"":"""",""ProviderName"":""Rovi"",""ReviewCount"":""1"",""ReviewScore"":""87"",""ReviewType"":""Critic"",""SourceUri"":"""",""Reviews"":[]},{""ReviewerMediaId"":"""",""ProviderName"":""Rotten Tomatoes"",""ReviewCount"":""235"",""ReviewScore"":""70"",""ReviewType"":""Critic"",""SourceUri"":""http://www.rottentomatoes.com/m/the_hunger_games_mockingjay_part_2"",""Reviews"":[{""CriticName"":""Peter Howell"",""Date"":""2015-11-19"",""Publication"":""Toronto Star"",""ReviewUri"":""http://www.thestar.com/entertainment/movies/2015/11/19/mockingjay-part-2-is-a-weak-end-to-the-hunger-games-franchise-review.html"",""Score"":""2/4"",""ScoreDescription"":""rotten"",""Text"":""What began so promisingly as a dystopian saga of gladiatorial games, resonating with current global fears, has turned into just another dull race for the almighty dollar."",""TextItems"":[]},{""CriticName"":""Michael O'Sullivan"",""Date"":""2015-11-19"",""Publication"":""Washington Post"",""ReviewUri"":""http://www.washingtonpost.com/goingoutguide/movies/movie-review-jennifer-lawrence-hits-her-mark-in-mockingjay--part-2/2015/11/18/55d6a4e0-8e1a-11e5-ae1f-af46b7df8483_story.html"",""Score"":""2.5/4"",""ScoreDescription"":""fresh"",""Text"":""As the dystopian epic's emotional, moral and physical heart, Lawrence once again delivers the best reason to stick with it."",""TextItems"":[]},{""CriticName"":""Colin Covert"",""Date"":""2015-11-19"",""Publication"":""Minneapolis Star Tribune"",""ReviewUri"":""http://www.startribune.com/review-the-hunger-games-mockingjay-part-2-closes-the-series-on-a-thrilling-high-note/351792331/"",""Score"":""3.5/4"",""ScoreDescription"":""fresh"",""Text"":""It is a fitting finale for a series that has set a high-water mark for screen adaptations of young adult fiction."",""TextItems"":[]},{""CriticName"":""David Edelstein"",""Date"":""2015-11-19"",""Publication"":""New York Magazine/Vulture"",""ReviewUri"":""http://www.vulture.com/2015/11/review-the-hunger-games-mockingjay-part-2.html"",""Score"":"""",""ScoreDescription"":""fresh"",""Text"":""A potent antiwar saga: bleak, savage, and very modern in the depiction of an unholy union between political manipulation and showbiz."",""TextItems"":[]},{""CriticName"":""Amy Nicholson"",""Date"":""2015-11-19"",""Publication"":""L.A. Weekly"",""ReviewUri"":""http://www.laweekly.com/film/jennifer-lawrence-and-the-hunger-games-transcend-the-blockbuster-6288595"",""Score"":""A"",""ScoreDescription"":""fresh"",""Text"":"" In the first Hunger Games film, we were simply meant to care whether Katniss won. Three movies later, the series has become about how horrible it can be to win. "",""TextItems"":[]},{""CriticName"":""Steven Rea"",""Date"":""2015-11-19"",""Publication"":""Philadelphia Inquirer"",""ReviewUri"":""http://www.philly.com/philly/entertainment/movies/20151120__The_Hunger_Games__Mockingjay_-_Part_2___End_of_the_line_for_Katniss_and_crew.html"",""Score"":""2.5/4"",""ScoreDescription"":""rotten"",""Text"":""If Mockingjay - Part 1 was walkier and talkier than its forerunners, Part 2 is pretty much all action - and lesser for it."",""TextItems"":[]},{""CriticName"":""Ty Burr"",""Date"":""2015-11-19"",""Publication"":""Boston Globe"",""ReviewUri"":""http://www.bostonglobe.com/arts/movies/2015/11/18/hunger/yOdMextvI1jnjV7z5PIjjK/story.html"",""Score"":""3/4"",""ScoreDescription"":""fresh"",""Text"":""Katniss is a Joan of Arc for a generation of reluctant warriors, and \""Mockingjay - Part 2\"" is a war movie for those distrustful of any and all leaders, especially the ones trying to sell you on a future."",""TextItems"":[]},{""CriticName"":""Kenneth Turan"",""Date"":""2015-11-19"",""Publication"":""Los Angeles Times"",""ReviewUri"":""http://www.latimes.com/entertainment/movies/la-et-mn-hunger-games-review-20151119-column.html"",""Score"":"""",""ScoreDescription"":""rotten"",""Text"":""The Hunger Games: Mockingjay - Part 2 is exactly what you would expect from its ungainly title, and that turns out to be not quite enough."",""TextItems"":[]},{""CriticName"":""Joe Morgenstern"",""Date"":""2015-11-19"",""Publication"":""Wall Street Journal"",""ReviewUri"":""http://www.wsj.com/articles/the-hunger-games-mockingjaypart-2-review-jennifer-lawrence-emerges-victorious-1447961853"",""Score"":"""",""ScoreDescription"":""fresh"",""Text"":""Katniss has remained, in Jennifer Lawrence's portrayal, a vividly vulnerable creature of flesh and blood surrounded by sci-fi extravagance of variable quality."",""TextItems"":[]},{""CriticName"":""Andrew Lapin"",""Date"":""2015-11-19"",""Publication"":""NPR"",""ReviewUri"":""http://www.npr.org/2015/11/19/456504011/mockingjay-part-2-sees-a-franchise-sputter-to-a-stop?utm_medium=RSS&utm_campaign=movies"",""Score"":"""",""ScoreDescription"":""rotten"",""Text"":""This Hunger Game is one too many, a 2010-era cash grab in its purest form, more akin to a stern-faced curtain call than a fleshed-out story with a beginning, middle, and end."",""TextItems"":[]},{""CriticName"":""Christopher Orr"",""Date"":""2015-11-21"",""Publication"":""The Atlantic"",""ReviewUri"":""http://www.theatlantic.com/entertainment/archive/2015/11/mockingjay-part-2-is-a-dull-slog-hunger-games/416874/"",""Score"":"""",""ScoreDescription"":""rotten"",""Text"":""A movie that is too silly to be so somber, and too somber to be much fun."",""TextItems"":[]},{""CriticName"":""Bruce Kirkland"",""Date"":""2015-11-20"",""Publication"":""Toronto Sun"",""ReviewUri"":""http://www.torontosun.com/2015/11/19/the-hunger-games-mockingjay--part-2-review-jennifer-lawrences-swan-song-disappoints"",""Score"":""3/5"",""ScoreDescription"":""fresh"",""Text"":""The Hunger Games, which kicked off in a blaze of guts 'n' glory in 2012, ends now with a sad whimper, along with a lot of big bangs signifying nothing."",""TextItems"":[]},{""CriticName"":""Peter Rainer"",""Date"":""2015-11-20"",""Publication"":""Christian Science Monitor"",""ReviewUri"":""http://www.csmonitor.com/The-Culture/Movies/2015/1119/The-Hunger-Games-Mockingjay-Part-2-Actress-Jennifer-Lawrence-is-still-formidable"",""Score"":""B-"",""ScoreDescription"":""fresh"",""Text"":""Director Francis Lawrence stages the action sequences... with a modicum of flair, and Julianne Moore as rebel leader Coin gives off some sparks, but for the most part there is nothing divertingly new or different about this franchise fade-out. "",""TextItems"":[]},{""CriticName"":""Matthew Lickona"",""Date"":""2015-11-20"",""Publication"":""San Diego Reader"",""ReviewUri"":""http://www.sandiegoreader.com/movies/the-hunger-games-mockingjay-part-2/"",""Score"":""1/5"",""ScoreDescription"":""rotten"",""Text"":""After the forced histrionics of Part 1, it's nice to see star Jennifer Lawrence being allowed to quiet down and act again. But the story still feels stretched, a countdown that slows as it approaches zero hour."",""TextItems"":[]},{""CriticName"":""Julia Cooper"",""Date"":""2015-11-20"",""Publication"":""Globe and Mail"",""ReviewUri"":""http://www.theglobeandmail.com/arts/film/film-reviews/saying-goodbye-to-the-hunger-games-series-wasnt-going-to-be-easy/article27367987/"",""Score"":""2.5/4"",""ScoreDescription"":""fresh"",""Text"":""This revenge plot animates Mockingjay Part 2 with a satisfying rage."",""TextItems"":[]},{""CriticName"":""Tom Long"",""Date"":""2015-11-20"",""Publication"":""Detroit News"",""ReviewUri"":""http://www.detroitnews.com/story/entertainment/2015/11/19/movie-review-mockingjay-hunger-games-jennifer-lawrence/76061604/"",""Score"":""B+"",""ScoreDescription"":""fresh"",""Text"":""Explosive, mostly true to the text, complex and chock full of action, \""The Hunger Games: Mockingjay - Part 2\"" should more than satisfy the franchise's many fans."",""TextItems"":[]},{""CriticName"":""James Berardinelli"",""Date"":""2015-11-19"",""Publication"":""ReelViews"",""ReviewUri"":""http://www.reelviews.net/reelviews/hunger-games-the-mockingjay-part-2"",""Score"":""2.5/4"",""ScoreDescription"":""rotten"",""Text"":""The Hunger Games movies began with much promise but after the pinnacle of Catching Fire, it has been a slog to the finish line. We're finally there and I feel more exhausted than fulfilled."",""TextItems"":[]},{""CriticName"":""Sara Stewart"",""Date"":""2015-11-19"",""Publication"":""New York Post"",""ReviewUri"":""http://nypost.com/2015/11/19/splitting-up-the-last-hunger-games-was-a-huge-mistake/"",""Score"":""2/4"",""ScoreDescription"":""rotten"",""Text"":""The final installment of the \""Hunger Games\"" franchise manages to give us everything we've been waiting for and still underwhelm."",""TextItems"":[]},{""CriticName"":""Ben Sachs"",""Date"":""2015-11-19"",""Publication"":""Chicago Reader"",""ReviewUri"":""http://www.chicagoreader.com/chicago/the-hunger-games-mockingjay-part-2/MovieTimes?oid=19310340"",""Score"":"""",""ScoreDescription"":""rotten"",""Text"":""This fourth and final installment of the Hunger Games franchise is by far the most dour, consisting mainly of dim, uninspired battle sequences."",""TextItems"":[]},{""CriticName"":""Gail Pennington"",""Date"":""2015-11-19"",""Publication"":""St. Louis Post-Dispatch"",""ReviewUri"":""http://www.stltoday.com/entertainment/movies/reviews/intense-satisfying-finale-for-hunger-games-series/article_3d340c9d-d2aa-5f77-b3bb-41595a46040b.html"",""Score"":""3/4"",""ScoreDescription"":""fresh"",""Text"":""An exciting, involving finale, streamlining the complicated end game of Collins' story without shortchanging the climactic action."",""TextItems"":[]}]},{""ReviewerMediaId"":"""",""ProviderName"":""Rotten Tomatoes"",""ReviewCount"":""33908"",""ReviewScore"":""68"",""ReviewType"":""User"",""SourceUri"":""http://www.rottentomatoes.com/m/the_hunger_games_mockingjay_part_2"",""Reviews"":[]},{""ReviewerMediaId"":"""",""Pro