rst ever Halloween-themed Simpsons episode, including the Twilight Zone parody, \""Hungry Are the Damned\"".  The collection also features such modern classics as \""The Devil and Homer Simpson\"", where Homer trades his soul to the devil for a donut; \""Citizen Kang\"", where aliens kill both candidates for President in order to take over America; and \""Life's a Glitch and then you Die\"", a terrifying look at the 21st century--almost as frightening, in fact, as things have actually been.  Each spine-tingling spectacular is \""funny ha ha\"", not to mention \""funny uh-oh,\"" and taken together they're eighteen of the scariest, most hilarious Simpsons segments of all time.  So get your fright on, download these goodies, and make every day Halloween with the Simpsons!"",""ProductTitle"":""Season 102"",""Franchises"":[],""Language"":""en"",""Markets"":[""US""]}],""MarketProperties"":[{""ExpectedNumberOfEpisodes"":0,""IsComplete"":true,""FirstEpisodeId"":""8D6KGWZK804F"",""PresaleFulfillmentDate"":null,""ComingSoonPurchaseDate"":null,""BlackoutData"":null,""OriginalPublicationDate"":""3000-01-01T00:00:00Z"",""ReleaseDate"":""2009-10-19T12:00:00Z"",""Studios"":[{""Name"":""Fox"",""Images"":[{""Uri"":""http://musicart.xboxlive.com/7/1c811200-0000-0000-0000-000000000002/504/image.jpg"",""ImagePurpose"":""logo"",""BackgroundColor"":"""",""ForegroundColor"":"""",""ImagePositionInfo"":"""",""Height"":110,""Width"":197,""Caption"":"""",""FileSizeInBytes"":0,""UnscaledImageSHA256Hash"":"""",""CropSafeZone"":null}]}],""Networks"":[{""Name"":""Fox"",""Images"":[{""Uri"":""http://musicart.xboxlive.com/7/1c811200-0000-0000-0000-000000000002/504/image.jpg"",""ImagePurpose"":""logo"",""BackgroundColor"":"""",""ForegroundColor"":"""",""ImagePositionInfo"":"""",""Height"":110,""Width"":197,""Caption"":"""",""FileSizeInBytes"":0,""UnscaledImageSHA256Hash"":"""",""CropSafeZone"":null}]}],""ContentRatings"":[{""RatingSystem"":""Microsoft"",""RatingDisclaimers"":[],""RatingDescriptors""